import React from "react";
import "./styles.scss";
import { NavLink } from "react-router-dom";
import { routeDeteil as routeDeteil } from "../../pages/DeteilPage";
import { routeContact as routeContactPage } from "../../pages/ContactPage";
import { routeMain as routeMainPage } from "../../pages/MainPage";
import { routeCategoryPage as routeSecondPage } from "../../pages/CategoryPage";
import { routeFind as routeFindPage } from "../../pages/FindPage";
import logo2 from "../../pictures/logo2.png";

const Header = () => {
  return (
    <header className="headerHed">
      <img className="imgR" src={logo2} alt={logo2} />

      <div className="imgW">MOVIESinfo</div>
      <div className="linkL">
        <nav>
          <NavLink to={routeMainPage()} activeClassName={"linkActive"}>
            Главная
          </NavLink>
          <NavLink to={routeSecondPage()} activeClassName={"linkActive"}>
            Фильмы по категориям
          </NavLink>
          <NavLink to={routeContactPage()} activeClassName={"linkActive"}>
            О нас
          </NavLink>
          <NavLink to={routeFindPage()} activeClassName={"linkActive"}>
            Поиск
          </NavLink>
        </nav>
      </div>
    </header>
  );
};
export default Header;
